  VALUES
    ('Porsche','https://hips.hearstapps.com/hmg-prod/images/2023-porsche-911-t-021-dsc04152-1669058415.jpg?crop=0.596xw:0.502xh;0.216xw,0.377xh&resize=1200:*','AC/DC''s mammoth power-chord roar became one of the most influential hard rock sounds of the ''70s and one of the defining sounds of rock and metal. In its own way, it was a reaction to the pompous art rock and lumbering arena rock of the early ''70s. AC/DC''s rock was minimalist -- no matter how huge and bludgeoning their guitar chords were, there was a clear sense of space and restraint.','t','2021-05-07 18:57:42.517205-07');
